workspace.query:
xquery version "1.0-ml";
declare namespace html = "http://www.w3.org/1999/xhtml";
declare function local:generate-triples($uri) {
let $content := fn:doc($uri)/envelope/content
let $doc-iri := sem:iri($uri)
let $creditor-iri :=  sem:iri(
  "http://baml.com/network-of-networks-organization#"|| 
  (fn:string($content/CDT_ULTMT_GCI_NO), xdmp:encode-for-NCName(fn:string($content/CDT_NAME1)))[. ne ""][1])
let $debtor-iri :=  sem:iri(
  "http://baml.com/network-of-networks-organization#"|| 
  (fn:string($content/DBT_ULTMT_GCI_NO), xdmp:encode-for-NCName(fn:string($content/DBT_NAME1)))[. ne ""][1])
return object-node { "content": $content, "triples": array-node {
  sem:triple($doc-iri, sem:iri("http://www.w3.org/2000/01/rdf-schema#label"), (fn:string($content/CDT_NAME1) || ": " || $content/NO_TRANS)),
  sem:triple(
    $doc-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#creditor"), 
    $creditor-iri
  ),
  sem:triple(
    $creditor-iri, 
    sem:iri("http://www.w3.org/2000/01/rdf-schema#label"), 
    fn:string($content/CDT_NAME1)
  ),
  sem:triple(
    $creditor-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#OrganizationName"), 
    fn:string($content/CDT_NAME1)
  ),
  sem:triple(
    $creditor-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#UltimateGciNo"), 
    fn:string($content/CDT_ULTMT_GCI_NO)
  ),
  sem:triple(
    $doc-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#debtor"), 
    $debtor-iri
  ),
  sem:triple(
    $debtor-iri, 
    sem:iri("http://www.w3.org/2000/01/rdf-schema#label"), 
    fn:string($content/DBT_NAME1)
  ),
  sem:triple(
    $debtor-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#OrganizationName"), 
    fn:string($content/DBT_NAME1)
  ),
  sem:triple(
    $debtor-iri, 
    sem:iri("http://baml.com/network-of-networks-predicate#UltimateGciNo"), 
    fn:string($content/DBT_ULTMT_GCI_NO)
  ),
  for $prop in $content/*
  let $prop-iri := sem:iri("http://baml.com/network-of-networks-predicate#"|| fn:string(fn:node-name($prop)))
  let $values :=  
    if (fn:matches(fn:string($prop),"^[0-9]{1,2}/[0-9]{1,2}/[0-9]{4,4}$")) then (
     try {
       xdmp:parse-dateTime("[M]/[D]/[Y0001]", $prop)
     } catch * {
       fn:string($prop)
     }
   ) else if (fn:matches(fn:string($prop),"[0-9]{1,2}/[0-9]{1,2}/[0-9]{4,4} [0-9]{2,2}:[0-9]{1,2}:[0-9]{1,2}.[0-9]+")) then (
     try {
       xdmp:parse-dateTime("[M]/[D]/[Y0001] [H]:[m]:[s].[f]", $prop)
     } catch * {
       fn:string($prop)
     }
   ) else if ($prop instance of number-node()) then
     fn:number($prop)
   else (
     fn:string($prop)
   )
  for $value in $values
  let $value-iri := sem:iri("http://baml.com/network-of-networks/objects/"|| xdmp:encode-for-NCName(fn:string($value)))
  return
    if ($value instance of xs:string) then (
      sem:triple($doc-iri, $prop-iri, $value-iri),
      sem:triple($value-iri, sem:iri("http://www.w3.org/2000/01/rdf-schema#label"), $value)
    ) else
      sem:triple($doc-iri, $prop-iri, $value)
 }}
};

let  $uris := cts:uris((), ("limit=50000"), cts:and-query((cts:json-property-scope-query("DIRECTION", cts:true-query()), cts:not-query(cts:collection-query("wire-transfer")))))
for $uri in $uris
return xdmp:spawn-function(function() { xdmp:document-insert($uri, local:generate-triples($uri),(), ("wire-transfers-triples")) }, <options xmlns="xdmp:eval"><transaction-mode>update-auto-commit</transaction-mode></options>)

import module namespace functx = "http://www.functx.com" at "/MarkLogic/functx/functx-1.0-nodoc-2007-01.xqy"; 

for $data at $count in 1 to 100000
let $years := ('2014','2015','2016','2017')
let $direction := ('Incoming', 'Outgoing', 'Book')
let $random := xdmp:random(2)+1
let $randomC := xdmp:random(xdmp:estimate(fn:collection('debtors')))+1
let $CDT := fn:collection('debtors')/debtors/debtors/debtors[$randomC][1]/text()
let $randomD := xdmp:random(xdmp:estimate(fn:collection('debtors')))+1
let $DBT := fn:collection('debtors')/debtors/debtors/debtors[$randomD][1]/text()
let $date := functx:pad-integer-to-length(xdmp:random(25)+1,2)
let $months := functx:pad-integer-to-length(xdmp:random(11)+1,2)
let $year := $years[xdmp:random(3)+1] 
let $amount := (xdmp:random(100)+ 1) * 10000
let $r-date := fn:concat('2016-',$months,'-',$date)
return 
let $doc := 
object-node{
    "content": object-node{
        "TRN_DATE":xs:dateTime(xs:date($r-date)),
        "DIRECTION":$direction[$random],
        "CDT_CUR":'',
        "CDT_NAME1":if($CDT) then $CDT else 'Test',
        "CDT_PARENT_GCI_NO":'',        
        "CDT_ULTMT_GCI_NO":'',
        "DBT_CUR":'',
        "DBT_NAME1":if($DBT) then $DBT else 'Test',        
        "DBT_PARENT_GCI_NO":'',        
        "DBT_ULTMT_GCI_NO":'',
        "DBT_AMOUNT":$amount,
        "CDT_AMOUNT":$amount,
        "NO_TRANS":xdmp:random(10)+1
      }
  }


return xdmp:document-insert(fn:concat('wires-',$count,'.json'), $doc, (), 'wire-transfer')
